import React, { useEffect, useState } from 'react'

function Users(){

  let url = 'https://jsonplaceholder.typicode.com/users'

  let [users, setUsers] = useState([])

  useEffect(() =>{
    fetch(url)
    .then(res => res.json())
    .then(data => setUsers(data))
  }, [])


  return (
    <div>
      {users.map(el => <p>{el.name}</p>)}
    </div>
  )
}

export default Users
